import React from "react";
import "./mainBoard.css";
import AuthForm from "./components/AuthForm";

function App() {
  return (
    <>
      <AuthForm />
      <button>글쓰기</button>
      <br />
      <label>
        <input type="text" name="search" />
        <button>검색</button>
      </label>
    </>
  );
}

export default App;
